use bytes::Bytes;
use ethereum_types::{Address, Bloom};
use keccak_hash::H256;
use serde::{Deserialize, Serialize};

use crate::{rlp::error::RLPDecodeError, serde_utils};

use super::{BlockBody, BlockHeader, LegacyTransaction, Transaction, Withdrawal};

#[allow(unused)]
#[derive(Debug, Deserialize)]
#[serde(rename_all = "camelCase")]
pub struct ExecutionPayloadV3 {
    parent_hash: H256,
    fee_recipient: Address,
    state_root: H256,
    receipts_root: H256,
    logs_bloom: Bloom,
    prev_randao: H256,
    #[serde(deserialize_with = "crate::serde_utils::u64::deser_hex_str")]
    block_number: u64,
    #[serde(deserialize_with = "crate::serde_utils::u64::deser_hex_str")]
    gas_limit: u64,
    #[serde(deserialize_with = "crate::serde_utils::u64::deser_hex_str")]
    gas_used: u64,
    #[serde(deserialize_with = "crate::serde_utils::u64::deser_hex_str")]
    timestamp: u64,
    #[serde(deserialize_with = "crate::serde_utils::bytes::deser_hex_str")]
    extra_data: Bytes,
    #[serde(deserialize_with = "crate::serde_utils::u64::deser_hex_str")]
    base_fee_per_gas: u64,
    block_hash: H256,
    transactions: Vec<EncodedTransaction>,
    withdrawals: Vec<Withdrawal>,
    #[serde(deserialize_with = "crate::serde_utils::u64::deser_hex_str")]
    blob_gas_used: u64,
    #[serde(deserialize_with = "crate::serde_utils::u64::deser_hex_str")]
    excess_blob_gas: u64,
}

#[allow(unused)]
#[derive(Debug)]
pub struct EncodedTransaction(pub Bytes);

impl<'de> Deserialize<'de> for EncodedTransaction {
    fn deserialize<D>(deserializer: D) -> Result<Self, D::Error>
    where
        D: serde::Deserializer<'de>,
    {
        Ok(EncodedTransaction(serde_utils::bytes::deser_hex_str(
            deserializer,
        )?))
    }
}

#[allow(unused)]
impl EncodedTransaction {
    fn decode(&self) -> Result<Transaction, RLPDecodeError> {
        // First byte indicates TransactionType unless it is a LegacyTransaction
        // TransactionType must be between 0 and 0x7f
        match self.0.first() {
            // Non Legacy Tx
            Some(tx_type) if *tx_type < 0x7f => {
                // Decode tx based on type
                // uses plain bytes, without rlp encoding
                let _tx_bytes = &self.0.as_ref()[1..];
                match *tx_type {
                    // Legacy
                    0x0 => unimplemented!("Legacy tx with type"), // TODO: check if this is a real case scenario
                    // EIP1559
                    0x2 => unimplemented!("Eip1559 tx"),
                    _ => unimplemented!("We don't know this tx type yet"),
                }
            }
            // Legacy Tx
            Some(_) => {
                LegacyTransaction::decode_rlp(self.0.as_ref()).map(Transaction::LegacyTransaction)
            }
            None => Err(RLPDecodeError::MalformedData),
        }
    }
}

// TODO: Consider adding a struct Block { block_header, block_body } and implementing TryInto
#[allow(unused)]
impl ExecutionPayloadV3 {
    fn into_block(self) -> Result<(BlockHeader, BlockBody), RLPDecodeError> {
        let block_body = BlockBody {
            transactions: self
                .transactions
                .iter()
                .map(|encoded_tx| encoded_tx.decode())
                .collect::<Result<Vec<_>, RLPDecodeError>>()?,
            ommers: vec![],
            withdrawals: self.withdrawals,
        };
        Ok((
            BlockHeader {
                parent_hash: self.parent_hash,
                ommers_hash: H256::zero(), // TODO: Use appropiate value
                coinbase: self.fee_recipient,
                state_root: self.state_root,
                transactions_root: block_body.compute_transactions_root(),
                receipt_root: self.receipts_root,
                logs_bloom: self.logs_bloom.into(),
                difficulty: 0.into(),
                number: self.block_number,
                gas_limit: self.gas_limit,
                gas_used: self.gas_used,
                timestamp: self.timestamp,
                extra_data: self.extra_data,
                prev_randao: self.prev_randao,
                nonce: 0, // TODO: Use appropiate value
                base_fee_per_gas: self.base_fee_per_gas,
                withdrawals_root: H256::zero(), // TODO: Use result of root calculation once implemented
                blob_gas_used: self.blob_gas_used,
                excess_blob_gas: self.excess_blob_gas,
                parent_beacon_block_root: H256::zero(), // TODO: Use appropiate value
            },
            block_body,
        ))
    }
}

#[allow(unused)]
#[derive(Debug, Deserialize, Serialize)]
#[serde(rename_all = "camelCase")]
pub struct PayloadStatus {
    status: PayloadValidationStatus,
    latest_valid_hash: H256,
    validation_error: Option<String>,
}

#[derive(Debug, Deserialize, Serialize)]
#[serde(rename_all = "UPPERCASE")]
pub enum PayloadValidationStatus {
    Valid,
    Invalid,
    Syncing,
    Accepted,
}

